    //             this.props.history.push("/profile");
    //         }
    //     )
    // };

    render() {
        return (
            <article class="card-body">
                <h4 class="card-title mb-4 mt-1"><strong>Welcome, Customer!</strong></h4>
                <form>
                    <div class="form-group">
                        <input name="" class="form-control" placeholder="Username" type="text" />
                    </div>
                    <div class="form-group">
                        <a class="float-right forgot" href="#">Forgot?</a>
                        <input class="form-control" placeholder="Password" type="password" />
                    </div>
                    <div class="form-group">
                        <div class="checkbox">
                            <label><input type="checkbox" /> Save password </label>
                        </div>
                    </div>
                    <div class="form-group">
                        <button type="submit" class="btn blue-btn btn-block"> Sign In </button>
                    </div>
                </form >
                <div class="border-top card-body text-center">Haven't any account yet? <Link to="/signup">Register</Link></div>

            </article >
        );
    }
}

export default withRouter(BuyerLogin);
